import { GET_USER, UPDATE_USER, DELETE_USER } from "../constants/reducers";

const initialState = {};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_USER:
    return

    case UPDATE_USER:

    case DELETE_USER:

    default:
      return state;
  }
}
